import React from 'react';
import './App.scss';
import Home from './components/Home/Home'
import SignIn from './components/SignIn/SignIn';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';

function App() {





  return (
    <div className="App">
      <div className="body">

    <Router>
      <Switch>
        <Route path='/home'>
                      <Home />
        </Route>

        <Route path='/signin'>
                      <SignIn />
        </Route>

      </Switch>


    </Router>


      </div>

    </div>
  );
}

export default App;
